export let DisplayPokemons = ({pokemons, keys}) => {
    let DisplayAttributes = ({p}) => {
        return (
            <ul >
              {keys.forEach(key => {
                  debugger
                        return <li key={key}>{key}: {p[key]}</li>
                    })}
            </ul>
        )
    }
    if (pokemons === undefined) return
    return (
        <div >

            {pokemons.map((p, index )=> {
                return <div key={index}>

                    <h4 >pokemon numer {p.number}:</h4>
                    <DisplayAttributes p={p} />
                </div>
            })}
        </div>
    );
}
